import React, {FunctionComponent} from 'react';
import Project from '../models/project';
import Client from '../models/client';
import  './project-card.css';
import { statut } from '../models/statut';

type Props = {
    project: Project,
    client: Client
};

const bothCard: FunctionComponent<Props> = ({project,client}) => {
    var st: string = statut[project.Statut];
    return (
        //Nom Client | Numero projet | Date Sign | Project Leader |	Statut | Detail/edit/delete 
        
        <div className="row" >
            <div className="card-content col m1"></div>
            <div className="card-content col grey darken-2 m2 center border">Client Name: {client.Company_Name} </div>
            <div className="card-content col grey darken-2 m2 center border">Project number: {project.ProjectNumber}</div>
            <div className="card-content col grey darken-2 m2 center border">Signature date: {project.SignatureDate}</div>
            <div className="card-content col grey darken-2 m2 center border">Project leader: {project.ProjectLeader}</div>
            <div className="card-content col grey darken-2 m2 center border">Statut: {project.Statut}</div>
        </div>

    )

} 

export default bothCard;
